import { useState, memo } from "react";
import scrollTo from "../utils/scrollTo";

const NAV_ITEMS = ["about", "experience", "projects", "skills", "contact"];

/**
 * Fixed top navigation bar.
 *
 * Props:
 *  isDark        {boolean}  ‚Äî current theme
 *  toggleTheme   {function} ‚Äî flip isDark
 *  scrolled      {boolean}  ‚Äî true when page has scrolled > 20px (shows border)
 *  activeSection {string}   ‚Äî id of the section currently in view
 */
const Navbar = memo(({ isDark, toggleTheme, scrolled, activeSection }) => {
  const [menuOpen, setMenuOpen] = useState(false);

  const handleNav = (id) => {
    scrollTo(id);
    setMenuOpen(false);
  };

  return (
    <>
      {/* ‚îÄ‚îÄ Desktop / main nav bar ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ */}
      <nav
        style={{
          position: "fixed", top: 0, left: 0, right: 0, zIndex: 100,
          background: "var(--nav-bg)",
          backdropFilter: "blur(24px)",
          WebkitBackdropFilter: "blur(24px)",
          borderBottom: scrolled ? "1px solid var(--border)" : "1px solid transparent",
          transition: "border-color 0.3s ease",
          padding: "0 clamp(16px, 4vw, 32px)",
        }}
      >
        <div style={{
          maxWidth: 1100, margin: "0 auto",
          display: "flex", alignItems: "center", justifyContent: "space-between",
          height: 64,
        }}>

          {/* Logo ‚Äî clicking goes to hero */}
          <button className="logo-btn" onClick={() => scrollTo("hero")} aria-label="Go to top">
            <span style={{ fontFamily: "'Syne',sans-serif", fontWeight: 800, fontSize: "1.15rem", color: "var(--accent)" }}>N</span>
            <span style={{ fontFamily: "'Syne',sans-serif", fontWeight: 800, fontSize: "1.15rem", color: "var(--text)" }}>P</span>
            <span style={{ fontFamily: "'DM Mono',monospace", fontSize: "0.57rem", color: "var(--text-muted)", marginLeft: 3 }}>.dev</span>
          </button>

          {/* Desktop links */}
          <div className="nav-desktop" style={{ display: "flex", gap: 28, alignItems: "center" }}>
            {NAV_ITEMS.map((id) => (
              <button
                key={id}
                className={`nav-link ${activeSection === id ? "active" : ""}`}
                onClick={() => handleNav(id)}
              >
                {id.charAt(0).toUpperCase() + id.slice(1)}
              </button>
            ))}
          </div>

          {/* Right controls: theme toggle + hamburger */}
          <div style={{ display: "flex", alignItems: "center", gap: 12 }}>
            <button
              onClick={toggleTheme}
              className="theme-toggle"
              title={isDark ? "Switch to Day mode" : "Switch to Night mode"}
            >
              <div className={`theme-toggle-knob ${isDark ? "right" : ""}`}>
                {isDark ? "üåô" : "‚òÄÔ∏è"}
              </div>
            </button>

            <button
              className={`hamburger ${menuOpen ? "open" : ""}`}
              onClick={() => setMenuOpen((p) => !p)}
              aria-label="Toggle menu"
            >
              <span /><span /><span />
            </button>
          </div>
        </div>
      </nav>

      {/* ‚îÄ‚îÄ Mobile dropdown ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ */}
      <div className={`mobile-menu ${menuOpen ? "open" : ""}`}>
        {NAV_ITEMS.map((id, idx) => (
          <button
            key={id}
            className={`mobile-nav-link ${activeSection === id ? "active" : ""}`}
            onClick={() => handleNav(id)}
          >
            <span style={{
              color: "var(--accent)",
              fontFamily: "'DM Mono',monospace",
              fontSize: 11, minWidth: 22, opacity: 0.7,
            }}>
              0{idx + 1}.
            </span>
            {id.charAt(0).toUpperCase() + id.slice(1)}
          </button>
        ))}
      </div>
    </>
  );
});

export default Navbar;
